import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate} from 'react-router-dom';
import { Login } from '../Login';
import { HomeGerente } from '../HomeGerente';
import { HomeFuncionario } from '../HomeFuncionario';

function App() {

  const isAuthenticated = false; // Altere isso para verificar se o usuário está autenticado ou não


  return (
      <Router>
        <Routes>
            if (isAuthenticated === 1) {
                <Route element={<HomeGerente />} path="/" exact />
            }else  if (isAuthenticated === 2) {
                <Route element={<HomeFuncionario />} path="/" exact />
            }
         
      
          <Route element={<Login />} path="/" exact />
       

        </Routes>
      </Router>
  );

}

export default App;
